import React, { Component } from 'react';
import { ListItem, ListInfo } from '../style';

class List extends Component {
  render() { 
    return (
      <div>
        <ListItem>
          <img className='list-pic' alt='' src='' />
          <ListInfo>
            <h3 className='title'></h3>
            <p className='desc'></p>
          </ListInfo>
        </ListItem>
      </div>

    );
  }
}

export default connect(mapState)(List);
